		var data = JSON.parse(jsontext);

		var domain = data.domain;
		var values = data.values;

		var bound = 0.1 * (domain[1] - domain[0]);

		var borel = [];
		borel.push([[domain[0] - bound, 0], [domain[0], 0]]);
		borel.push([[domain[1], 0], [domain[1] + bound, 0]]);

		var lower_probability = [];
		var upper_probability = [];

		for (var i = 0; i < values.length; i++)
		{
			if (values[i].borel == 1)
			{
				borel.push([[values[i].interval[0], 0], [values[i].interval[1], 0]]);
			}
			lower_probability.push([i, values[i].probability[0]]);
			upper_probability.push([i, values[i].probability[1]]);
		}

		$.plot("#borel", borel, {
			series: {
				lines: { show: true },
				points: { show: true }
			}});
		
		$.plot("#probability", [lower_probability, upper_probability], {
			series: {
				lines: { show: true },
				points: { show: false }
			}});

		// Add the Flot version string to the footer

		$("#footer").prepend("Flot " + $.plot.version + " &ndash; ");
